  [],\n\t\"revision_timestamp\": \"2016-08-04T08:17:12.179324\",\n\t\"name\": \"yukon-delta-national-wildlife-refuge-narrative-report-calendar-year-1993\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Yukon
  Delta National Wildlife Refuge outlines Refuge accomplishments during the 1993 calendar
  year.  The report begins with a summary of the year's highlights and weather conditions.
  Land acquisition is covered. The report includes a planning section which discusses
  the master plan, the management plan, and public participation. Refuge administration
  is outlined; information about personnel, youth programs, volunteer programs, funding,
  and safety is given. Habitat management is also covered; subjects include wetlands,
  forests, grazing, fire management, and wilderness areas. The wildlife section of
  the report discusses wildlife diversity, endangered and threatened species, waterfowl,
  marsh birds and waterbirds, shorebirds, raptors, game mammals, marine mammals, fisheries
  resources, scientific collections, and marking and banding. The public uses of the
  Refuge described in this report include outdoor classrooms, interpretive programs,
  hunting, fishing, trapping, wildlife observation, outdoor recreation, and law enforcement.
  The equipment and facilities section of the report provides information about new
  construction, rehabilitation, major maintenance, and energy conservation. Items
  of interest are provided at the end.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
